import { useEffect,useState } from "react"
import { fetchFinnHub } from "../api_s/fetchFinnhub"
import Stock from "./Stock"
function StockList(){
    const [stocks,setStocks]=useState(null)
    useEffect(()=>{
        // fetchFinnHub().then(data=>setStocks(data)).catch(err=>console.error(err))
        function printConsole(){
            console.log("salut")
        }
        const interval=setInterval(printConsole,5000)
        return()=>clearInterval(interval)
    },[])
    return(
        <tbody>
            {stocks&& stocks.map(element =><Stock stock={element} key={element.symbol}/>)}
        </tbody>
    )
}
export default StockList
